package ifblock;

public class Nestedif {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=40;
		
		if(a==b) {
			System.out.println("less than");
		}if(a>=b) {
			System.out.println("Equal");
		}if(a<=b) {
			System.out.println("Dont print");
		}

	}

}
